import * as ReactDOM from 'react-dom';
import * as React from 'react';
import { SampleBase } from '../common/sample-base';
import { DocumentEditorContainerComponent, Toolbar, CommentDeleteEventArgs } from '@syncfusion/ej2-react-documenteditor';
import { TitleBar } from './title-bar';
import { DialogUtility } from '@syncfusion/ej2-popups';

import './default.component.css';
DocumentEditorContainerComponent.Inject(Toolbar);

// tslint:disable:max-line-length
export class Comments extends SampleBase<{}, {}> {
    private hostUrl: string = 'https://services.syncfusion.com/react/production/api/documenteditor/';
    public container: DocumentEditorContainerComponent;
    public titleBar: TitleBar;
    public rendereComplete(): void {
        window.onbeforeunload = function () {
            return 'Want to save your changes?';
        }
        this.container.documentEditor.pageOutline = '#E0E0E0';
        this.container.documentEditor.acceptTab = true;
        this.container.documentEditor.resize();
        this.titleBar = new TitleBar(document.getElementById('documenteditor_titlebar'), this.container.documentEditor, true);
        this.onLoadDefault();
    }

    render() {
        return (<div className='control-pane'>
            <div className='control-section'>
                <div id='documenteditor_titlebar' className="e-de-ctn-title"></div>
                <div id="documenteditor_container_body">
                    <DocumentEditorContainerComponent id="container" ref={(scope) => { this.container = scope; }} style={{ 'display': 'block' }}
                      height={'590px'} serviceUrl={this.hostUrl}  enableToolbar={true} showPropertiesPane={false} locale='en-US' userColor = '#b70f34' currentUser='Nancy Davolio'/>
                </div>
            </div>
            <div id="action-description">
            <p>This example demonstrates the comments only type of document protection which allows users to add or edit comments alone in the document. To unprotect the document, use password '123'..</p>
            </div>
            <div id="description">
                <div>
                <p>In this example, comments features in the document editor can be found.</p>
    <ul>
        <li>Add or edit a comment.</li>
        <li>Reply to a comment.</li>
        <li>Resolving the comment discussion.</li>
    </ul>
                    <p style={{ 'display': 'block' }}> More information about the document editor features can be found in this <a target="_blank" href="https://ej2.syncfusion.com/react/documentation/document-editor/comments/">documentation section.</a>
                    </p>
                </div>
            </div>
        </div>);
    }

    onLoadDefault = (): void => {
        // tslint:disable
        let defaultDocument: object = {"sfdt":""};
        
        // tslint:enable        
        this.container.documentEditor.open(JSON.stringify(defaultDocument));
        this.container.documentEditor.documentName = 'Comments';
        this.container.documentEditor.showComments = true;
        this.titleBar.updateDocumentTitle();
        this.container.documentChange = (): void => {
        this.titleBar.updateDocumentTitle();
        this.container.documentEditor.focusIn();
        };
        this.container.commentDelete = (args:CommentDeleteEventArgs):void =>
        {
            if(args.author !== this.container.documentEditor.currentUser)
            {
                args.cancel=true;
                DialogUtility.alert({
                    title: 'Information',
                    content: "Delete restriction enabled. Only the author of the comment can delete it.",
                    showCloseIcon: true,
                    closeOnEscape: true,
                });
        }
    }
        
    }
}
